    <child ID="1850" label="pav:'contributed by'" layerID="1"
        created="1421974909907" x="438.27527" y="1728.2361"
        width="170.31372" height="44.0" strokeWidth="1.0"
        autoSized="false" xsi:type="node">
        <notes>The resource was contributed to by the given agent.%nl;%nl;Specifies an agent that provided any sort of help in conceiving the work that is expressed by the digital artifact.%nl;%nl;Contributions can take many forms, of which PAV define the subproperties pav:authoredBy and pav:curatedBy; however other specific roles could also be specified by pav:contributedBy or custom subproperties, such as illustrating, investigating or managing the underlying data source. Contributions can additionally be expressed in detail using prov:qualifiedAttribution and prov:hadRole.%nl;%nl;Note that pav:contributedBy identifies only agents that contributed to the work, knowledge or intellectual property, and not agents that made the digital artifact or representation (pav:createdBy), thus the considerations for software agents is similar to for pav:authoredBy and pav:curatedBy.%nl;%nl;pav:contributedBy is more specific than its superproperty dct:contributor - which might or might not be interpreted to also cover contributions to making the representation of the artifact.%nl;%nl;%nl;The date of contribution can be expressed using pav:contributedOn - note however in the case of multiple contributors that there is no relationship in PAV identifying which agent contributed when or what. If capturing such lineage is desired, it should be additionally expressed using PROV relationships like prov:qualifiedAttribution or prov:wasGeneratedBy.</notes>
        <fillColor>#005E9C</fillColor>
        <strokeColor>#776D6D</strokeColor>
        <textColor>#FFFFFF</textColor>
